  true,\n\t\"url\": null,\n\t\"notes\": \"The version 2.0 Aquarius CAP Level 2 product
  contains the first release of the operational orbital/swath data based on the Combined
  Active Passive (CAP) algorithm.  CAP is a P.I. produced data set developed and provided
  by the JPL Climate Oceans and Solid Earth group (S. Yueh).   This Level 2 data set
  contains sea surface salinity (SSS), wind speed and wind direction data derived
  from 3 different radiometers and the scatterometer aboard the AQUARIUS/SAC-D satellite.
  \ The CAP algorithm simultaneously retrieves the salinity, wind speed and direction
  by minimizing the sum of squared differences between model and observations. Each
  data file covers one 98 minute orbit.\",\n\t\"license_title\": \"U.S. Government
